svg.script:
window.addEventListener("load", function() {

	var svg = document.getElementById('a9k-mpa-20x10ge');
	var tooltip = svg.getElementById('tooltip');
	var tooltipText = tooltip.getElementsByTagName('text')[0];
	var tooltipRects = tooltip.getElementsByTagName('rect');
	var triggers = svg.getElementsByClassName('tooltip-trigger');

    for (var i = 0; i < triggers.length; i++) {
		triggers[i].addEventListener('mousemove', showTooltip);
		triggers[i].addEventListener('mouseout', hideTooltip);
	}

	function showTooltip(evt) {
		var pt = svg.createSVGPoint();
		pt.x = evt.clientX;
		pt.y = evt.clientY;
		pt = pt.matrixTransform(svg.getScreenCTM().inverse());
		var r_pt_x = pt.x + 30;
		var r_pt_y = pt.y + 280;
		tooltip.setAttributeNS(null, "transform", "translate(" + r_pt_x + " " + r_pt_y + ")");
		tooltip.setAttributeNS(null, "visibility", "visible");

		tooltipText.firstChild.data = evt.target.getAttributeNS(null, "data-tooltip-text");
		var length = tooltipText.getComputedTextLength();
		for (var i = 0; i < tooltipRects.length; i++) {
			tooltipRects[i].setAttributeNS(null, "width", length + 8);
		}
	}

	function hideTooltip(evt) {
		tooltip.setAttributeNS(null, "visibility", "hidden");
	}

	var params = document.defaultView.frameElement.getElementsByTagName("param")[0].value;

	var countArray = 0;
	var getLocal = JSON.parse(localStorage.getItem('arraysInfoPort'));

	var getLineTitle = localStorage.getItem('linetitle').split(",");

    var countLine = 1;
    var numPort = 1;

		for(var i=0; i<getLocal.length; i++){
				for(var j=0; j<getLocal[i].length; j++){
					var splitCard = getLocal[i][j].split(/[()]/);
					if (splitCard[0].includes("A9K-MOD") === true){
						if(splitCard[1] === params){
							if(countLine%11 != 0){
								if(getLocal[i][2] === "up"){
									var path1 = document.getElementById("p" + numPort).style.fill = "green";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								} else if(getLocal[i][2] === "down") {
									var path1 = document.getElementById("p" + numPort).style.fill = "red";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								} else if(getLocal[i][2] === "admin_down"){
									var path1 = document.getElementById("p" + numPort).style.fill = "grey";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								} else {
									var path1 = document.getElementById("p" + numPort).style.fill = "black";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								}
								countLine++;
								numPort+=2;
							} else {
								countLine=1;
								numPort=2;
								if(getLocal[i][2] === "up"){
									var path1 = document.getElementById("p" + numPort).style.fill = "green";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								} else if(getLocal[i][2] === "down") {
									var path1 = document.getElementById("p" + numPort).style.fill = "red";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								} else if(getLocal[i][2] === "admin_down"){
									var path1 = document.getElementById("p" + numPort).style.fill = "grey";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								} else {
									var path1 = document.getElementById("p" + numPort).style.fill = "black";
									var path1 = document.getElementById("p" + numPort).setAttribute('data-tooltip-text', getLocal[i][1] + " | status:" + getLocal[i][2]);
								}
								numPort+=2;
							}
						}
					}
				}

		}

});
